import { Box, Text } from "components";
import React from "react";

export const Login = () => {
  return (
    <Box
      // horizontalArrangement="space-between"
      fullHeight
      // verticalArrangement="space-between"
      style={{}}>
      <h1>Login Page</h1>
      <button type="button" className="btn btn-primary">
        Primary
      </button>
      <Text variant={"body"}>simple</Text>
      <Text variant="h1">simple</Text>
      <Text variant="h2">simple</Text>
      <Text variant="h3">simple</Text>
      <div>
        <Button label="Click Me" onClick={handleClick} />
        <Button label="Loading Button" isLoading />
        <Button label="Disabled Button" disabled />
        <Button
          label="Button with Icons"
          leftIcon={<i className="bi bi-arrow-left" />}
          rightIcon={<i className="bi bi-arrow-right" />}
          onClick={handleClick}
        />
      </div>
    </Box>
  );
};
